import {State} from 'react'
import { View, TouchableOpacity, Text, TextInput, StyleSheet } from 'react-native';

export default function App() {
  var value = "teste";
  return (
    <View>
      <TextInput value={value}/>
      <TouchableOpacity onPress={()=>{value="outro texto"}}>
        <Text>Executar</Text>
      </TouchableOpacity>
    </View>
  );
}
